selector_to_html = {"a[href=\"#abstract-classes\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Abstract Classes<a class=\"headerlink\" href=\"#abstract-classes\" title=\"Permalink to this heading\">#</a></h2><p>Abstraction is the hiding of the details of a programmes implementation from the programme\u2019s user, who can only see the essential details required for the interface.</p><p>In C++ abstraction is achieved using <a class=\"reference internal\" href=\"glossary.html#term-Abstract-Classes\"><span class=\"xref std std-term\">abstract classes</span></a> - which are classes that cannot be instantiated i.e. you cannot create on named instance of the abstract class.</p>", "a[href=\"#virtual-destructors\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Virtual Destructors<a class=\"headerlink\" href=\"#virtual-destructors\" title=\"Permalink to this heading\">#</a></h2><p>Destructors can be virtual - it is considered best practice is to make the base destructor virtual in any case involving polymorphism.</p><p>If a virtual function is used anywhere in the class hierarchy a virtual destructor should be added to prevent memory leaks.</p>", "a[href=\"glossary.html#term-Pure-Virtual-Member-Function\"]": "<dt id=\"term-Pure-Virtual-Member-Function\">Pure Virtual Member Function</dt><dd><p>A virtual member function in a base class that is declared using the pure specifier <code class=\"docutils literal notranslate\"><span class=\"pre\">=</span> <span class=\"pre\">0</span></code> syntax, which makes the class abstract.</p></dd>", "a[href=\"#more-on-access-specifiers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">More on Access Specifiers<a class=\"headerlink\" href=\"#more-on-access-specifiers\" title=\"Permalink to this heading\">#</a></h2><p>The access specifier <code class=\"docutils literal notranslate\"><span class=\"pre\">protected</span></code> indicates that the data members may only used by the class and by classes derived from it. <code class=\"docutils literal notranslate\"><span class=\"pre\">name</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">age</span></code> are protected membere - they are accessible in derived classes but not outside.</p><p><code class=\"docutils literal notranslate\"><span class=\"pre\">class</span> <span class=\"pre\">Student</span> <span class=\"pre\">:</span> <span class=\"pre\">public</span> <span class=\"pre\">Person</span></code> - specifies that <code class=\"docutils literal notranslate\"><span class=\"pre\">Student</span></code> publicly inherits from <code class=\"docutils literal notranslate\"><span class=\"pre\">Person</span></code>.</p>", "a[href=\"#virtual-functions\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Virtual Functions<a class=\"headerlink\" href=\"#virtual-functions\" title=\"Permalink to this heading\">#</a></h2><p><strong>Virtual member functions</strong>, also know <strong>methods</strong> allow the programmer to declare functions in a base class that can be redefined in each derived class.</p><p>Declaring a particular function as <code class=\"docutils literal notranslate\"><span class=\"pre\">virtual</span></code> in the base class allows that function identifier to act as an interface to the definitions of the function in both the base and derived classes. The compiler and linker will guarantee the correct correspondence between objects and the functions applied to them.</p>", "a[href=\"#exampleAD2\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleAD2\">\n<p class=\"admonition-title\">Code Example: Derived Class Construction </p>\n<section id=\"code_example-content\">\n<p>An example of a derived class:</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;string&gt;</span>\n\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">protected</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"p\">;</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">Person</span><span class=\"p\">(</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">(</span><span class=\"n\">init_name</span><span class=\"p\">),</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"p\">(</span><span class=\"n\">init_age</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{}</span><span class=\"w\"> </span><span class=\"c1\">// Constructor</span>\n<span class=\"w\">    </span><span class=\"kt\">void</span><span class=\"w\"> </span><span class=\"n\">displayInfo</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Name: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">Age: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Student</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"k\">public</span><span class=\"w\"> </span><span class=\"n\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">private</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"c1\">// Constructor using base class constructor</span>\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"p\">(</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"k\">const</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"o\">&amp;</span><span class=\"w\"> </span><span class=\"n\">init_studentID</span><span class=\"w\"> </span><span class=\"p\">)</span>\n<span class=\"w\">        </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"n\">Person</span><span class=\"p\">(</span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">),</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">(</span><span class=\"n\">init_studentID</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{}</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">printStudentID</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">Person</span><span class=\"w\"> </span><span class=\"n\">person</span><span class=\"p\">(</span><span class=\"s\">\"Alice\"</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">21</span><span class=\"p\">);</span><span class=\"w\">  </span><span class=\"c1\">//Create instance of Person</span>\n<span class=\"w\">    </span><span class=\"n\">person</span><span class=\"p\">.</span><span class=\"n\">displayInfo</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">(</span><span class=\"s\">\"Bob\"</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">20</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"s\">\"F123456\"</span><span class=\"p\">);</span><span class=\"w\"> </span><span class=\"c1\">// Create an instance of Student</span>\n<span class=\"w\">    </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">displayInfo</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"ID: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">printStudentID</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationAD2\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleAD2\"> Code Example: Derived Class Construction </a></p>\n<section id=\"code_explanation-content\">\n<p>The constructor for derived classes must call the base class\u2019s constructor.</p>\n<p>This ensures the base class is constructed before extra data is added to make the instance of your derived class. This requires that there must be a constructor for the base class.</p>\n<p>Order of construction is important - Call the base class constructors in order of derivation, i.e. if Class3 is derived from Class2, which is derived from Class1, the Class1 constructor musst be called first, followed by the Class2 constructor and so on.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#exampleAD3\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleAD3\">\n<p class=\"admonition-title\">Code Example: Virtual Member Functions </p>\n<section id=\"code_example-content\">\n<p>An example of virtual member functions:</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"cp\">#include</span><span class=\"w\"> </span><span class=\"cpf\">&lt;string&gt;</span>\n\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">protected</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"p\">;</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">Person</span><span class=\"p\">(</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">(</span><span class=\"n\">init_name</span><span class=\"p\">),</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"p\">(</span><span class=\"n\">init_age</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{}</span><span class=\"w\"> </span>\n<span class=\"w\">   </span>\n<span class=\"w\">    </span><span class=\"k\">virtual</span><span class=\"w\"> </span><span class=\"kt\">void</span><span class=\"w\"> </span><span class=\"n\">displayInfo</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Name: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">Age: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Student</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"k\">public</span><span class=\"w\"> </span><span class=\"n\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">private</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"p\">(</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"k\">const</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"o\">&amp;</span><span class=\"w\"> </span><span class=\"n\">init_id</span><span class=\"p\">)</span>\n<span class=\"w\">        </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"n\">Person</span><span class=\"p\">(</span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">),</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">(</span><span class=\"n\">init_id</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{}</span>\n<span class=\"w\">    </span><span class=\"k\">virtual</span><span class=\"w\"> </span><span class=\"kt\">void</span><span class=\"w\"> </span><span class=\"n\">displayInfo</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Student Name: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">Age: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">Student ID: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">Person</span><span class=\"w\"> </span><span class=\"n\">person</span><span class=\"p\">(</span><span class=\"s\">\"Alice\"</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">21</span><span class=\"p\">);</span><span class=\"w\">  </span><span class=\"c1\">//Create instance of Person</span>\n<span class=\"w\">    </span><span class=\"n\">person</span><span class=\"p\">.</span><span class=\"n\">displayInfo</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">(</span><span class=\"s\">\"Bob\"</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">20</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"s\">\"F123456\"</span><span class=\"p\">);</span><span class=\"w\"> </span><span class=\"c1\">// Create an instance of Student</span>\n<span class=\"w\">    </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">displayInfo</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationAD3\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleAD3\"> Code Example: Virtual Member Functions </a></p>\n<section id=\"code_explanation-content\">\n<p>Every instance of the derived class <code class=\"docutils literal notranslate\"><span class=\"pre\">Student</span></code> also has the data members called <code class=\"docutils literal notranslate\"><span class=\"pre\">name</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">age</span></code> that were inherited from the base class <code class=\"docutils literal notranslate\"><span class=\"pre\">Person</span></code>.</p>\n<p>Note: there is no constructor, or setter\u2019s for the person class, so not much can be done with it.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"#inheritance-derived-classes\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Inheritance - Derived Classes<a class=\"headerlink\" href=\"#inheritance-derived-classes\" title=\"Permalink to this heading\">#</a></h1><p>A <strong>derived class</strong> (or sub-class) is a new class that inherits properties from a <strong>base Class</strong>.</p><p>Classes are described as base classes (or super-classes) when other classess are derived from them.</p>", "a[href=\"#construction-of-derived-classes\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Construction of Derived Classes<a class=\"headerlink\" href=\"#construction-of-derived-classes\" title=\"Permalink to this heading\">#</a></h2><p>It is better to use constructors with member list initialisation, however C++ does not permit the initialisation of inherited data members using the normal member initialiser list technique - this ensures that a const base class member is permitted - since such a value would be set by the base class constructor before the derived constructor starts.</p><p>As shown above - not const data members (and references) can be changed by a parameterised constructor, which is OK if we ignore that the value is actually being set twice! Once by the base constructor, possibly to a default value, and again by the derived class constructor.</p>", "a[href=\"#exampleAD1\"]": "<div class=\"code_example dropdown admonition\" id=\"exampleAD1\">\n<p class=\"admonition-title\">Code Example: Derived Classes </p>\n<section id=\"code_example-content\">\n<p>An example of a derived class:</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"cp\">#include</span><span class=\"cpf\">&lt;iostream&gt;</span>\n<span class=\"cp\">#include</span><span class=\"cpf\">&lt;string&gt;</span>\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">protected</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"p\">{};</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"kt\">void</span><span class=\"w\"> </span><span class=\"n\">displayInfo</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"k\">const</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"Name: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">name</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">Age: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"sc\">'\\n'</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n<span class=\"k\">class</span><span class=\"w\"> </span><span class=\"nc\">Student</span><span class=\"w\"> </span><span class=\"o\">:</span><span class=\"w\"> </span><span class=\"k\">public</span><span class=\"w\"> </span><span class=\"n\">Person</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"k\">private</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"k\">public</span><span class=\"o\">:</span>\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"p\">(</span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">init_studentID</span><span class=\"p\">)</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"n\">name</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">init_name</span><span class=\"p\">;</span><span class=\"w\"> </span><span class=\"n\">age</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">init_age</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"w\"> </span><span class=\"o\">=</span><span class=\"w\"> </span><span class=\"n\">init_studentID</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">string</span><span class=\"w\"> </span><span class=\"n\">printStudentID</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">        </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"n\">studentID</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"p\">}</span>\n<span class=\"p\">};</span>\n<span class=\"kt\">int</span><span class=\"w\"> </span><span class=\"nf\">main</span><span class=\"p\">()</span><span class=\"w\"> </span><span class=\"p\">{</span>\n<span class=\"w\">    </span><span class=\"n\">Student</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">{</span><span class=\"w\"> </span><span class=\"s\">\"Bob\"</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"mi\">20</span><span class=\"p\">,</span><span class=\"w\"> </span><span class=\"s\">\"F123456\"</span><span class=\"w\"> </span><span class=\"p\">};</span><span class=\"w\"> </span><span class=\"c1\">// Create an instance of Student</span>\n<span class=\"w\">    </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">displayInfo</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"ID: \"</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"n\">student</span><span class=\"p\">.</span><span class=\"n\">printStudentID</span><span class=\"p\">();</span>\n<span class=\"w\">    </span><span class=\"n\">std</span><span class=\"o\">::</span><span class=\"n\">cout</span><span class=\"w\"> </span><span class=\"o\">&lt;&lt;</span><span class=\"w\"> </span><span class=\"s\">\"</span><span class=\"se\">\\n</span><span class=\"s\">\"</span><span class=\"p\">;</span>\n<span class=\"w\">    </span><span class=\"k\">return</span><span class=\"w\"> </span><span class=\"mi\">0</span><span class=\"p\">;</span>\n<span class=\"p\">}</span>\n</pre></div>\n</div>\n</div>\n</div>\n<div class=\"code_explanation dropdown admonition\" id=\"explanationAD1\">\n<p class=\"admonition-title\">Explanation of  <a class=\"reference internal\" href=\"#exampleAD1\"> Code Example: Derived Classes </a></p>\n<section id=\"code_explanation-content\">\n<p>Every instance of the derived class <code class=\"docutils literal notranslate\"><span class=\"pre\">student</span></code> also has data members called <code class=\"docutils literal notranslate\"><span class=\"pre\">name</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">age</span></code> that were inherited from <code class=\"docutils literal notranslate\"><span class=\"pre\">Person</span></code>, including the constuctor - i.e. there is no need to create new versions of the inherited members.</p>\n<p>This is not a good example for several reasons.</p>\n<p>In this example, the base class has only it\u2019s default constructor - so can only be intialised with default value - and since there are no accessor function either, an instanc of Person would be fairly useless.</p>\n<p>Because there is only the default constructor - we cannot use member list initalisaiton in the constructor yet, although parameterised construction is fine.</p>\n</section>\n</div>\n</section>\n</div>", "a[href=\"glossary.html#term-Abstract-Classes\"]": "<dt id=\"term-Abstract-Classes\">Abstract Classes</dt><dd><p>Classes that only defines an interface - used as a base class. Declaring a <a class=\"reference internal\" href=\"#term-Pure-Virtual-Member-Function\"><span class=\"xref std std-term\">pure virtual member function</span></a> makes the class abstract and prevents creation of objects of the abstract class. Use of abstract classes is one of the most effective ways of minimizing the impact of changes in a C++ program and for minimizing compilation time.</p></dd>", "a[href=\"glossary.html#term-Virtual-Functions\"]": "<dt id=\"term-Virtual-Functions\">Virtual Functions</dt><dd><p>A member function that a derived class can override; the primary mechanism for run-time polymorphism in C++. A virtual member function is sometimes called a method.</p></dd>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false, theme: 'material', duration: [200, 100], delay: [200, 0],

            });
        };
    };
    console.log("tippy tips loaded!");
};
